import React from 'react';
import Line from './Charts/Line';
import LineRadar from './Charts/Area';
import RangeColumn from './Charts/RangeColumn';
import Pie from './Charts/Pie';
import Donut from './Charts/Donut';
import Pie2 from './Charts/Pie2';
import Candle from './Charts/Candle';
import Scatter from './Charts/Scatter';
import Mix from './Charts/Mix';
import '../App.css';
import { Preview, print } from 'react-html2pdf';
export default function Dashboard() {
    function generatePDF() {

        // Choose the element id which you want to export.
        var element = document.getElementById('divToExport');
        element.style.width = '700px';
        element.style.height = '900px';
        var opt = {
            margin:       0.5,
            filename:     'myfile.pdf',
            image:        { type: 'jpeg', quality: 1 },
            html2canvas:  { scale: 1 },
            jsPDF:        { unit: 'in', format: 'letter', orientation: 'portrait',precision: '12' }
          };

        // choose the element and pass it to html2pdf() function and call the save() on it to save as pdf.
        html2pdf().set(opt).from(element).save();
      }
    return (
        <>
        <button onClick={generatePDF}> export</button>
        <div>
            <div className='shadow p-3 mb-5 bg-white rounded'>
                <Line />
            </div>
            <br></br>
            <div className='shadow p-3 mb-5 bg-white rounded'>
                <LineRadar />
            </div>
            <br></br>
            <div className='shadow p-3 mb-5 bg-white rounded'>
                <RangeColumn />
            </div>
            <br></br>
            <div className='row'>

                    <div className='col '><div className='shadow p-3 mb-5 bg-white rounded'> <Pie /></div>
                </div>
                <div className='col'><div className='shadow p-3 mb-5 bg-white rounded'><Donut /></div></div>
                <div className='col'><div className='shadow p-3 mb-5 bg-white rounded'><Pie2 /></div></div>
            </div>
            <br></br>
            <div className='shadow p-3 mb-5 bg-white rounded'>
            <Candle />
          </div>
            <br></br>
            <div className='shadow p-3 mb-5 bg-white rounded'>
            <Scatter />
            </div>
            <br></br>
            <div className='shadow p-3 mb-5 bg-white rounded'>
            <Mix />
            </div>
        </div>
        </>
    )
}
